import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-symptoms',
  templateUrl: './symptoms.component.html',
  styleUrls: ['./symptoms.component.css']
})
export class SymptomsComponent {
navigateToSTI() {
throw new Error('Method not implemented.');
}
navigateToSTD() {
throw new Error('Method not implemented.');
}
  constructor(private router: Router) {}

  navigateToSTIComponent() {
    this.router.navigate(['/sti']);
  }

  navigateToSTDComponent() {
    this.router.navigate(['/std']);
  }
}
<body><div class="container my-5">
  <div class="row justify-content-center">
    <div class="col-lg-8 col-md-10">
      <h1 class="text-center mb-4">Check Your Symptoms</h1>
      <p class="text-center mb-5">Select the option that best fits your current health condition.</p>
      <div class="d-flex justify-content-center">
        <div class="btn-group">
          <button class="btn btn-primary btn-lg px-5" (click)="navigateToSTIComponent()">
            Sexually Transmitted Infections (STI)
          </button>
          <button class="btn btn-primary btn-lg px-5" (click)="navigateToSTDComponent()">
            Sexually Transmitted Diseases (STD)
          </button>
        </div>
      </div>
    </div>
  </div>
</div>
</body>
